// DefaultPatchSetMentor executes a bulk gorm update call with patch behavior
func DefaultPatchSetMentor(ctx context.Context, objects []*Mentor, updateMasks []*field_mask.FieldMask, db *gorm.DB) ([]*Mentor, error) {
	if len(objects) != len(updateMasks) {
		return nil, fmt.Errorf(errors.BadRepeatedFieldMaskTpl, len(updateMasks), len(objects))
	}

	results := make([]*Mentor, 0, len(objects))
	for i, patcher := range objects {
		pbResponse, err := DefaultPatchMentor(ctx, patcher, updateMasks[i], db)
		if err != nil {
			return nil, err
		}

		results = append(results, pbResponse)
	}

	return results, nil
}

// DefaultApplyFieldMaskMentor patches an pbObject with patcher according to a field mask.
func DefaultApplyFieldMaskMentor(ctx context.Context, patchee *Mentor, patcher *Mentor, updateMask *field_mask.FieldMask, prefix string, db *gorm.DB) (*Mentor, error) {
	if patcher == nil {
		return nil, nil
	} else if patchee == nil {
		return nil, errors.NilArgumentError
	}
	var err error
	for _, f := range updateMask.Paths {
		if f == prefix+"Id" {
			patchee.Id = patcher.Id
			continue
		}
		if f == prefix+"HeroId" {
			patchee.HeroId = patcher.HeroId
			continue
		}
		if f == prefix+"Bio" {
			patchee.Bio = patcher.Bio
			continue
		}
		if f == prefix+"Skill" {
			patchee.Skill = patcher.Skill
			continue
		}
		if f == prefix+"MaxRate" {
			patchee.MaxRate = patcher.MaxRate
			continue
		}
		if f == prefix+"MinRate" {
			patchee.MinRate = patcher.MinRate
			continue
		}
	}
	if err != nil {
		return nil, err
	}
	return patchee, nil
}

